import './App.css';
import React,{useState,useEffect} from 'react';
import axios from 'axios';

import 'bootstrap/dist/css/bootstrap.min.css'
function App() {
  return (
    <div className="App">
      Hello,World!
      FARM STUCK
      <div className='App list-group-item justify-content-center 
      align-items-center mx-auto' style={{"width":"400px",
      "background":"white","marginTop":"15px"}}>
        <h1 className='card text-white bg-primary mb-1' styleName="max-width:20rem;">
          Task Manager
        </h1>
        <h6 className='card text-white bg-primary mb-3'>
          FASTAPI - React - MongoDB
        </h6>
        <div className='card-body'>
          <h5 className='card text-white bg-dark mb-3'>
            Add Your Task
          </h5>
          <span className='card-text'></span>
        </div>

      </div>

    </div>
  );
}

export default App;
